import 'bootstrap/dist/css/bootstrap.min.css';
import React, { useState, useEffect } from 'react';
import { Table } from 'react-bootstrap';
import Button from '@mui/material/Button';
import EditIcon from '@mui/icons-material/Edit';
import DeleteForeverIcon from '@mui/icons-material/DeleteForever';
import axios from 'axios';
import { Link } from 'react-router-dom';

const ReadOrder = () => {
  const [orders, setOrders] = useState([]);


  //save data in list
  const getOrders = async () => {
    const result = await axios.get('http://localhost:8080/getcustomerorders')
    setOrders(result.data.reverse());
  };

  useEffect(() => {
    getOrders();
  }, []);

  const deletehandler = async (displayOrderId) => {
    await axios.delete(`http://localhost:8080/deleteorder/${displayOrderId}`);
    getOrders();
  };

  return (
    <div>
      <div style={{
        marginTop: "100px", marginLeft: "200px", overflow: "auto", width: "1000px", height: "400px", boxShadow: ' 5px 5px 10px #808080'
      }}>
        <Link to="/placeorder">
        <Button variant="contained">place Order</Button></Link>
        <h1 style={{ background: "#87CEFA", textAlign: 'center', color: "white" }}>Read Order Details </h1>
        <Table striped bordered hover size="sm">
          <thead className='thead-dark'>
            <tr>
              <th>displayOrderId</th>
              <th>customerName </th>
              <th>productName</th>
              <th>mobileNo</th>
              <th>modelNo</th>
              <th>brandName</th>
              <th>ProductColor </th>
              <th>category</th>
              <th>subCategory</th>
              <th>discription</th>
              <th>orderDate </th>
              <th>expectedDeliveryDate</th>
              <th>logisticName</th>
              <th>awbNo</th>
              <th>couponCode </th>
              <th>action </th>
            </tr>
          </thead>
          <tbody >
            {
              orders.map((orders, index) => {
                return (
                  <tr key={index}>
                    <td >{orders.displayOrderId}</td>
                    <td>{orders.customerName}</td>
                    <td>{orders.productName}</td>
                    <td>{orders.mobileNo}</td>
                    <td>{orders.modelNo}</td>
                    <td>{orders.brandName}</td>
                    <td>{orders.ProductColor}</td>
                    <td>{orders.category}</td>
                    <td>{orders.subCategory}</td>
                    <td>{orders.discription}</td>
                    <td>{orders.orderDate}</td>
                    <td>{orders.expectedDeliveryDate}</td>
                    <td>{orders.logisticName}</td>
                    <td>{orders.awbNo}</td>
                    <td>{orders.couponCode}</td>
                    <td><Link className="btn btn-primary mr-2"to={`/updateorder/${orders.displayOrderId}`}  >{<EditIcon />}</Link></td>
                    <td> <Button variant="danger" onClick={() => deletehandler(orders.displayOrderId)}>{<DeleteForeverIcon />}</Button></td>
                  </tr>
                )
              })
            }
          </tbody>
        </Table>
      </div>
    </div>
  );
}



export default ReadOrder;
